import React from "react";

function Banner() {
  return (
    <>
      <section>
        <div
          class="banner-1 cover-image sptb-2 sptb-tab bg-background2"
          data-image-src="../../../public/assets/images/banners/headerindex.jpg"
        ></div>
      </section>
    </>
  );
}

export default Banner;
